            import React,{ useState } from 'react';
            
            import axios from "axios";
            import "./styles.css";


            export default function Home(props) {

            //const [message, setMessage] = useState("");
            const [temp, setTemp] = useState("");
            const [weatherDescription, setWeatherDescription] = useState("");
            const [icon, setIcon] = useState("");
            const [imageURL, setImageURL] = useState("");
            //const year= 'Ergophile © ';

            //   useEffect(() => {
            //     fetch("http://localhost:8000/message")
            //       .then((res) => res.json())
            //       .then((data) => setMessage(data.message));
            //   }, []);
        
            navigator.geolocation.getCurrentPosition((position)=> {
                const p=position.coords;
                const latitude = p.latitude;
                const longitude =p.longitude;

                const baseURL = "https://api.openweathermap.org/data/2.5/onecall?lat="+latitude+"&lon="+longitude+"&units=metric&exclude=hourly,daily,minutely&appid=9a1c24bc57e0a112e9c6de16daf9f833";
                axios.get(baseURL).then((res) => {
                    
                    setTemp(Math.round(res.data.current.temp)+"°C");
                    setWeatherDescription(res.data.current.weather[0].description);
                    setIcon(res.data.current.weather[0].icon);
                    setImageURL("https://openweathermap.org/img/wn/"+icon+"@2x.png");
                });
        
            });
        
                return (
                    <div className="Home">
                    <body>
                    <nav>
                    <div className="menu">
                        <div class="logo">
                                <a href="/">Portfolio</a>
                        </div>
                                <ul>
                                <li><a href="/">Home</a></li>
                                <li><a href="/career">Career</a></li>
                                <li><a href="/contact">Contact</a></li>
                                <li><a href="/login">Login</a></li>
                                </ul>
                    </div>
                    </nav>
                    <br></br><br></br><br></br><br></br><br></br>
                    <table cellpadding="1" cellspacing="0" border="0" align="center" style="height: 549px; width: 99%;">
                    <tbody>
                        <tr>
                        <td valign="top" style="height: 350px; width: 36%;">
                        <table cellpadding="0" cellspacing="0" border="0" style="width: 97%">
                        <tbody>
                        <tr valign="middle" style="height: 50px">
                        <td width="20px"></td>
                        <td class="headerCSS">WELCOME TO SBILIFE GROUP CUSTOMER PORTAL
                        </td>
                        <td width="20px"></td>
                         </tr>
                        <tr>
                        <td width="20px"></td>
                        <td>
                        <hr class="horizontalrule"></hr>
                        </td>
                        <td width="20px"></td>
                        </tr>
                        <tr>
                        <td width="20px"></td>
                        <td style="text-align: justify" class="textnormal">To provide our esteemed Group Customers an enhanced experience, our "Online Group
                            Customer Service" initiative has been launched. This would enable you to view your
                            policy details and request various services related to your policy. You can now
                            enjoy our service at your convenience.
                            <br>
                            <br>
                            For any suggestions or queries,please contact our nearest SBI Life office or call
                            us at our toll free no 1800 267 9090.You can write to us at:info@sbilife.co.in
                        </br>
                        <td width="20px"></td>
                        </br>
                        </td>
                        </tr>
                        </tbody>
                        </table>
                </td>
                </tr>

            </tbody>  
            </table>
            </body>
            </div>
            
                );
        }
